'use strict'

const URIS = [
  'data:image/png;base64,',
  'data:image/png;base64,',
  'data:image/png;base64,',
  'data:image/png;base64,'
]

class DefaultAvatars {
  constructor() {
    this.uris = URIS
  }

  next() {
    const image = this.uris.shift()
    this.uris.push(image)
    return image
  }
}

export default DefaultAvatars
